import { useNavigate } from 'react-router-dom';
import ImageList from '@mui/material/ImageList';
import ImageListItem from '@mui/material/ImageListItem';
import ImageListItemBar from '@mui/material/ImageListItemBar';
import { Box, List } from '@mui/material';
import ImgMediaCard from './ImageMedia';
import { Stack } from '@mui/system';
import Pagination from '@mui/material/Pagination';
import axios from 'axios';
import {Typography} from '@mui/material';

import {Link} from '@mui/material';
import { ProductionQuantityLimitsSharp } from '@mui/icons-material';

export default function Feed() {
  const y= (x)=>{
    if(x<600) return 2;
    else  return 4;
  }
  const z= (x)=>{
    if(x<600) return "180px";
    else  return "350px";
  }
  let products=[];
  let [find ,setfind]=useState(false);
  var width = window.innerWidth;
  const api=axios.create({
    baseURL:"http://localhost:5000"
  })
  const [wait,setwait]=useState(false)
  useEffect(()=>{
    api.get('/product')
    .then(async res=>{
      if(res.status===200){
        products=res.data;
        console.log("products",products);
        setfind(true);
      
      }
    })
    .catch(err=>{
      console.log(err)
    })
  },[])
  return (
    <Box flex={7}  >
      <List sx={{
        
      }}> 
      {
        find && [0,1,2].map((product) =>{

          <Box key={product} sx={{
            borderColor:"red",
            borderWidth:"1px"
                      }}>
            <Typography  sx={{backgroundColor:"white",
            height:"50px"
            }}>{product}</Typography>
        <Link href="/electronics">
            <ImageListItem sx={{width:z(width)}} >
                <img
                    src={`${product.pid}?w=248&fit=crop&auto=format`}
                    alt={product}
                    loading="lazy"
                />
        </ImageListItem>
        </Link>
        </Box>
        }
        )
      }
      
      </List>

    { /*<ImageList 
      cols={y(width)}
    >
      <ImgMediaCard />
      <ImgMediaCard />
      <ImgMediaCard />
      <ImgMediaCard />
      <ImgMediaCard />
      <ImgMediaCard />
      <ImgMediaCard />
      <ImgMediaCard />
      <ImgMediaCard /> 
    </ImageList> */}
    <Stack spacing={2}>
      <Pagination count={10} color="primary" />
    </Stack>
    <Box height={100}>

    </Box>
    </Box>
  );
}
